import styled from 'styled-components';

function CommonBtn({ color, text }) {
    return (
        <>
            <Buttonn color={color}>{text}</Buttonn>
        </>
    );
}

const Buttonn = styled.button`
    padding: 6px 20px;
    border-radius: 5px;
    border: 0;
    background-color: transparent;
    border: 1px solid red;
`;

export default CommonBtn;
